var title_f8_2_8226="Modified dynamic labral shear test";
var content_f8_2_8226=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1124px;\">",
"  <div class=\"videoplayer\" h264=\"./images/EM/82892/Mod_dyn_labral_shear_video.mp4?title=Modified+dynamic+labral+shear+test\" style=\"width:480px;height:288px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Modified dynamic labral shear test",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 323px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The modified dynamic labral shear test is performed with the patient standing, their shoulder abducted to 120 degrees, arm kept in the scapular plane, elbow flexed to 90 degrees, and their shoulder externally rotated until they feel tightness in the shoulder. The examiner then pushes the proximal humerus anteriorly, thereby providing a shear force to the glenohumeral joint, while lowering the arm from 120 degrees to 60 degrees of abduction using the other hand. External rotation is maintained throughout. A positive test elicits pain or a painful clicking or catching sensation at the posterior joint line when the arm is abducted between 120 degrees and 90 degrees.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Stephen Simons, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
