"     7.5-200 mg (100): $364.28",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F6694729\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Signs/symptoms of bleeding; periodic CBC and chemistry profile with long-term use; blood pressure",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F180172\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Dovir (CO)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F180150\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Hydrocodone: Binds to opiate receptors in the CNS, altering the perception of and response to pain; suppresses cough in medullary center; produces generalized CNS depression",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ibuprofen: Reversibly inhibits cyclooxygenase-1 and 2 (COX-1 and 2) enzymes, which result in decreased formation of prostaglandin precursors; has antipyretic, analgesic, and anti-inflammatory properties",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F180166\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Ibuprofen:",
"     </b>",
"     See Ibuprofen monograph.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Hydrocodone:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Onset of action: Narcotic analgesic: 10-20 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Duration: 4-8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Protein binding: 19% to 45%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Metabolism: Hepatic; O-demethylation; via primarily CYP2D6 to hydromorphone (major, active metabolite with ~10- to 33-fold higher or as much as a &gt;100-fold higher binding affinity for the mu-opioid receptor than hydrocodone); N-demethylation via CYP3A4 to norhydrocodone (major metabolite); and ~40% of metabolism/clearance occurs via other non-CYP pathways, including 6-ketosteroid reduction to 6-alpha-hydrocol and 6-beta-hydrocol, and other elimination pathways (eg, fecal, biliary, intestinal, renal) (Hutchinson, 2004; Volpe, 2011; Zhou, 2009)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Half-life elimination: 4.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Time to peak: 1.7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Excretion: Urine (26% of single dose in 72 hours, with ~12% as unchanged drug, 5% as norhydrocodone, 4% as conjugated hydrocodone, 3% as 6-hydrocodol, and 0.21% as conjugated 6-hydromorphol (Zhou, 2009)",
"    </p>",
"   </div>",
