var title_f8_2_8234="EP study tracings RF ablation atrial flutter";
var content_f8_2_8234=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69946%7ECARD%2F60090&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69946%7ECARD%2F60090&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 579px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study and radiofrequency catheter ablation of typical atrial flutter",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 559px; height: 392px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Three surface ECG leads (I, aVF, V1) and intracardiac recordings from the high right atrium (HRA), a mapping catheter in the isthmus between the tricuspid valve and inferior vena cava (TV-IVC) (HBE1-2), eight recordings from a catheter extending from the lateral right atrial wall through the TV-IVC isthmus and into the ostium of the coronary sinus (CS15-1 to CS 1-2), and right ventricular apex (RVA3-4) in a patient with typical atrial flutter. The tip of the mapping catheter was initially positioned on the tricuspid annulus, and then dragged through the TV-IVC isthmus to the ostium of the IVC during RF application; atrial flutter terminated. Note that the atrial activation (A) blocks between CS7-8 and CS 5-6, which on fluoroscopy corresponded to the position of the mapping catheter.",
"    <div class=\"footnotes\">",
"     Fl: flutter waves; V: ventricular electrogram.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 545px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study and radiofrequency catheter ablation of atrial flutter showing bidirectional isthmus block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 525px; height: 371px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, V1) and intracardiac recordings from the high right atrium (HRA), eight recordings from a catheter extending from the lateral right atrial wall through the tricuspid valve-inferior vena cava (TV-IVC) isthmus and into the ostium of the coronary sinus (CS15-1 through CS1-2), and right ventricular apex (RVA3-4) in a patient who has undergone ablation for atrial flutter. Left panel shows pacing (PA) from the lateral right atrial wall; the impulse is propagated down the lateral wall of the high right atrium, generating an atrial electrogram (A), to the lateral TV-IVC isthmus region (CS13-1, CS 11-1, CS9-10) where conduction is blocked. The medial aspect of the isthmus is not depolarized until a wavefront of activation comes down the interatrial septum or from the low left atrium; the distal poles of the catheter are therefore depolarized late and in the opposite direction, from the coronary sinus ostium back towards the medial TV-IVC isthmus (CS 3-4, CS 5-6, CS 7-8). Right panel shows pacing from the coronary sinus ostium. In this case, the medial isthmus is depolarized promptly (CS 3-4, CS 5-6), but conduction is blocked within the isthmus (CS7-8). Thus, activation of the lateral wall of the right atrium is delayed until a wavefront travels up the septum and across the roof of the right atrium. Activation of the proximal poles of the catheter is therefore delayed and occurs from high to low (CS 15-1, CS 13-1, CS 11-1, CS9-10). Patients with bidirectional block across the TC-IVC isthmus have a low rate of atrial flutter recurrence.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
